import React, { useState } from "react";

const APPS_SCRIPT_URL = "https://script.google.com/macros/s/AKfycbwfcy3EBEohly6fSu8Mfr_aJYM2XOjhn4fpKOxJsXkY8YRvS5dW7IMPk0lK8_1TEUt4/exec";


export default function Auth({ onLogin }) {
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // SHA-256 helper (returns hex string)
  async function sha256(message) {
    const encoder = new TextEncoder();
    const data = encoder.encode(message);
    const hashBuffer = await crypto.subtle.digest("SHA-256", data);
    const hashArray = Array.from(new Uint8Array(hashBuffer));
    return hashArray.map((b) => b.toString(16).padStart(2, "0")).join("");
  }

  function validateEmail(value) {
    return /^.+@+.+\..+$/.test(value);
  }

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);

    const normalizedEmail = (email || "").trim().toLowerCase();

    if (!validateEmail(normalizedEmail)) {
      setError("Please enter a valid email address.");
      return;
    }
    if (!password) {
      setError("Please enter a password.");
      return;
    }

    if (APPS_SCRIPT_URL.includes("REPLACE_WITH")) {
      setError("Please set APPS_SCRIPT_URL in Auth.js to your Apps Script Web App URL.");
      return;
    }

    setLoading(true);
    try {
      const passwordHash = await sha256(password);

      const payload = {
        email: normalizedEmail,
        password: passwordHash,
        action: isLogin ? "login" : "register",
      };

    const resp = await fetch(APPS_SCRIPT_URL, {
      method: "POST",
      mode: "cors", // <— important
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(payload),
    });


      const text = await resp.text();

      let result;
      try {
        result = JSON.parse(text);
      } catch (err) {
        result = { status: resp.ok ? "success" : "error", message: text || (resp.ok ? "Success" : "Server error") };
      }

      if (result.status === "success") {
        // notify parent (App) about successful login
        onLogin(normalizedEmail);
      } else {
        setError(result.message || "Authentication failed.");
      }
    } catch (err) {
      setError("Network or server error: " + (err.message || err));
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-container">
      <div className="card auth-card">
        <h2 className="section-title center">{isLogin ? "Login" : "Register"} to use Resume Analyzer</h2>

        <form onSubmit={handleSubmit}>
          <input
            className="text-input"
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            disabled={loading}
          />

          <input
            className="text-input"
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            disabled={loading}
          />

          <button type="submit" className="btn primary full-width" disabled={loading}>
            {loading ? (isLogin ? "Logging in..." : "Registering...") : isLogin ? "Login" : "Register"}
          </button>
        </form>

        {error && (
          <p className="error" style={{ color: "#b00020", marginTop: "0.6rem" }}>
            {error}
          </p>
        )}

        <div className="switch-auth center" style={{ marginTop: "0.8rem" }}>
          <span style={{ marginRight: "0.5rem" }}>{isLogin ? "Need an account?" : "Already have an account?"}</span>
          <button
            className="link-button"
            onClick={() => {
              setIsLogin(!isLogin);
              setError(null);
            }}
            type="button"
            disabled={loading}
          >
            {isLogin ? "Register" : "Login"}
          </button>
        </div>

        <p className="hint center mt-1" style={{ marginTop: "0.6rem" }}>
          <small>Passwords are hashed client-side with SHA-256 before being sent (demo only).</small>
        </p>
      </div>
    </div>
  );
}
